import React, {useState, useEffect} from 'react'
import "./button.css"








const Button = ()=>{

    const [counter, setCounter] = useState(0);
  
    useEffect(() => {
      document.title = `You clicked ${counter} times`;
    });
  

  return (<button className="btn" type ="button" onMouseover= {() => setCounter(counter + 1)}>Register now! `${counter}` hovers </button>
  )
}
export default Button;
